import React, { useState, useEffect } from 'react'
import logoImage from '../../assets/images/logo_sorted.png'
import { navLinks } from '../../constants/navigation'

const Navbar: React.FC = () => {
  const [isOpen, setIsOpen] = useState(false)
  const [isScrolled, setIsScrolled] = useState(false)

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 20)
    }

    window.addEventListener('scroll', handleScroll, { passive: true })
    return () => window.removeEventListener('scroll', handleScroll)
  }, [])

  const scrollToSection = (sectionId: string) => {
    const element = document.getElementById(sectionId)
    if (element) {
      const offset = 80 // Height of fixed navbar
      const elementPosition = element.getBoundingClientRect().top
      const offsetPosition = elementPosition + window.pageYOffset - offset

      window.scrollTo({
        top: offsetPosition,
        behavior: 'smooth',
      })
      setIsOpen(false)
    }
  }

  return (
    <>
      {/* Navbar */}
      <nav
        className={`fixed top-0 w-full z-50 transition-all duration-300 ${
          isScrolled
            ? 'bg-white shadow-lg py-2'
            : 'bg-white/95 backdrop-blur-sm py-4'
        }`}
        role="navigation"
        aria-label="Main navigation">
        <div className="container">
          <div className="flex items-center justify-between">
            {/* Logo */}
            <button
              onClick={() => scrollToSection('hero')}
              className="flex items-center space-x-3 group"
              aria-label="Sorted & Organized by CM - Home">
              <img
                src={logoImage}
                alt="Sorted & Organized Logo"
                className={`transition-all duration-300 ${
                  isScrolled ? 'h-10 md:h-12' : 'h-12 md:h-14'
                }`}
              />
            </button>

            {/* Desktop Navigation */}
            <nav
              className="hidden lg:flex items-center space-x-8"
              aria-label="Desktop navigation">
              {navLinks.map((link) => (
                <button
                  key={link.id}
                  onClick={() => scrollToSection(link.id)}
                  className="relative text-charcoal hover:text-gold-highlight transition-colors duration-200 text-sm font-medium group">
                  {link.label}
                  <span className="absolute bottom-0 left-0 w-0 h-0.5 bg-gold-highlight transition-all duration-300 group-hover:w-full"></span>
                </button>
              ))}
              <a
                href="tel:+16123084781"
                className="btn-primary text-sm px-4 py-2">
                (612) 308-4781
              </a>
            </nav>

            {/* Mobile Menu Button */}
            <button
              onClick={() => setIsOpen(!isOpen)}
              className="lg:hidden p-2 text-charcoal hover:text-gold-highlight focus:outline-none focus-visible:ring-2 focus-visible:ring-gold-highlight rounded-lg"
              aria-label={isOpen ? 'Close menu' : 'Open menu'}
              aria-expanded={isOpen}>
              <svg
                className="h-6 w-6 transition-transform duration-200"
                fill="none"
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth="2"
                viewBox="0 0 24 24"
                stroke="currentColor">
                {isOpen ? (
                  <path d="M6 18L18 6M6 6l12 12" />
                ) : (
                  <>
                    <path d="M4 8h16" />
                    <path d="M4 16h16" />
                  </>
                )}
              </svg>
            </button>
          </div>
        </div>
      </nav>

      {/* Mobile Navigation Overlay */}
      <div
        className={`fixed inset-0 bg-charcoal/50 z-40 lg:hidden transition-opacity duration-300 ${
          isOpen
            ? 'opacity-100 pointer-events-auto'
            : 'opacity-0 pointer-events-none'
        }`}
        onClick={() => setIsOpen(false)}
        aria-hidden="true"
      />

      {/* Mobile Navigation Panel */}
      <nav
        className={`fixed top-0 right-0 h-full w-80 max-w-full bg-white shadow-2xl z-50 lg:hidden transform transition-transform duration-300 ${
          isOpen ? 'translate-x-0' : 'translate-x-full'
        }`}
        aria-label="Mobile navigation">
        <div className="flex items-center justify-between p-6 border-b border-fog-gray">
          <div className="flex items-center space-x-3">
            <img
              src={logoImage}
              alt="Sorted & Organized Logo"
              className="h-10"
            />
            <span className="font-serif text-xl text-charcoal">SORTED</span>
          </div>
          <button
            onClick={() => setIsOpen(false)}
            className="p-2 text-charcoal hover:text-gold-highlight rounded-lg focus:outline-none focus-visible:ring-2 focus-visible:ring-gold-highlight"
            aria-label="Close menu">
            <svg
              className="h-6 w-6"
              fill="none"
              viewBox="0 0 24 24"
              stroke="currentColor">
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d="M6 18L18 6M6 6l12 12"
              />
            </svg>
          </button>
        </div>

        <div className="p-6">
          <ul className="space-y-4">
            {navLinks.map((link) => (
              <li key={link.id}>
                <button
                  onClick={() => scrollToSection(link.id)}
                  className="block w-full text-left px-4 py-3 text-lg text-charcoal hover:text-gold-highlight hover:bg-fog-gray rounded-lg transition-all duration-200">
                  {link.label}
                </button>
              </li>
            ))}
          </ul>

          <div className="mt-8 pt-8 border-t border-fog-gray">
            <a
              href="tel:+16123084781"
              className="btn-primary w-full justify-center mb-4">
              <svg
                className="w-5 h-5 mr-2"
                fill="currentColor"
                viewBox="0 0 20 20">
                <path d="M2 3a1 1 0 011-1h2.153a1 1 0 01.986.836l.74 4.435a1 1 0 01-.54 1.06l-1.548.773a11.037 11.037 0 006.105 6.105l.774-1.548a1 1 0 011.059-.54l4.435.74a1 1 0 01.836.986V17a1 1 0 01-1 1h-2C7.82 18 2 12.18 2 5V3z" />
              </svg>
              (612) 308-4781
            </a>
            <a
              href="mailto:sortedorganizedbycm@gmail.com"
              className="flex items-center justify-center px-4 py-3 text-charcoal hover:text-gold-highlight transition-colors">
              <svg
                className="w-5 h-5 mr-2"
                fill="currentColor"
                viewBox="0 0 20 20">
                <path d="M2.003 5.884L10 9.882l7.997-3.998A2 2 0 0016 4H4a2 2 0 00-1.997 1.884z" />
                <path d="M18 8.118l-8 4-8-4V14a2 2 0 002 2h12a2 2 0 002-2V8.118z" />
              </svg>
              Email Us
            </a>
          </div>
        </div>
      </nav>

      {/* Spacer for fixed navbar */}
      <div
        className={`transition-all duration-300 ${
          isScrolled ? 'h-16' : 'h-20'
        }`}
      />
    </>
  )
}

export default Navbar
